import {MDBContainer} from "mdbreact";
import React from "react";
import {Radar} from "react-chartjs-2";
import config from './components/config/defaultblueprint.json';

const bp=config.chartInfo.dataRadar

const RadarChartV=()=>{

    return (
      <MDBContainer>
        <h3 className="mt-5">Radar chart</h3>
        <Radar width={bp.width} data={bp} options={{ responsive: true }} />
      </MDBContainer>
    );
  }

export default RadarChartV;
